import React, {useState} from 'react';
import {Row, Col} from 'antd';
import {Center} from "../hoc/Center";

const matrix = [
    [1, 2, 3],
    [4, 5, 6],
    [7, 8, 9]
]

function Game() {

    const [numHover, setNumHover] = useState<number| null>(null)

    const hovering = (id: number) => setNumHover(id)

    return (
        <>
            <Center>
                {
                    matrix.map(e => (
                        <>
                            <Row>
                                {e.map(i =>(
                                    <Col
                                        span={8}
                                        onMouseEnter={() => hovering(i)}
                                        className={'cell-hover'}>{i}</Col>
                                ))}
                            </Row>
                        </>
                    ))
                }
            </Center>
        </>
    );
}

export default Game;
